Vc sabia que a primeira mesa foi desenhada por Deus? 
Inclusive toda a metragem de como teria que ser uma mesa. Ele vai além de nós e já sabia a importância de sentar à mesa com nossa família.
Vc sabia que isso influencia até no índice de divórcio? 
Muitas vezes devido a correria do dia a dia e outras prioridades, quase não se tem o hábito de sentar à mesa, e isso dá uma brecha para que a distância, a falta de diálogo e de aconchego tome conta da vida do casal. 
E na mesa o Pão da presença reina trazendo cura. 
Se estamos sentados em frente precisamos olhar para o cônjuge, ninguém consegue só olhar para o prato.; se estamos ao lado o sentimos ainda mais próximo; algum momento precisamos pedir p passar o alimento... e assim começa a quebra do orgulho, da raiva, do desentendimento, gerando a comunhão. 
